//     <Header />
//   </Provider>,
//   document.getElementById('header_section')
// );

ReactDOM.render(
  <Provider store={store}>
    <App />
  </Provider>,
  document.getElementById('default_section')
);

// If you want to start measuring performance in your app, pass a function
